(1004,-223,'',1004,0,1,'','','html1','전 딱한마디만 하고 이제 슬롯내려놓겟습니다.','<p style=\"box-sizing: border-box; font-family: &quot;Nanum Gothic&quot;, Dotum, sans-serif; word-break: break-all; line-height: 2; font-size: 14.5px; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);\">지금까지 몇억을 들이부어도 진짜 오공이나 다른제휴사들 그래요 도박이란게..10명잃으면 한명딴다고쳐도.</p><p style=\"box-sizing: border-box; font-family: &quot;Nanum Gothic&quot;, Dotum, sans-serif; word-break: break-all; line-height: 2; font-size: 14.5px; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);\">적당히 빨아먹어야..겜도하고그러죠. 오늘 오기로 재입을 수십번을 더햇습니다.이게 마지막이라고 생각하고</p><p style=\"box-sizing: border-box; font-family: &quot;Nanum Gothic&quot;, Dotum, sans-serif; word-break: break-all; line-height: 2; font-size: 14.5px; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);\">통장잔고 잇는거 다꼬라부엇습니다. 솔직히 딸생각도없엇고 딴다한들 그렇게 기분이 썩 좋지는 않을거같앗습니다.</p><p style=\"box-sizing: border-box; font-family: &quot;Nanum Gothic&quot;, Dotum, sans-serif; word-break: break-all; line-height: 2; font-size: 14.5px; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);\">너무 질려버렷네요 이제는..본업에 충실해야하는데 이게머라고... 수천만원 수억 마이너스 되면서도&nbsp;</p><p style=\"box-sizing: border-box; font-family: &quot;Nanum Gothic&quot;, Dotum, sans-serif; word-break: break-all; line-height: 2; font-size: 14.5px; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);\">이렇게 한게 참 후회되지만 저의선택이니 후회는 안해야하지만 진짜 후회되네여 ㅋㅋ</p><p style=\"box-sizing: border-box; font-family: &quot;Nanum Gothic&quot;, Dotum, sans-serif; word-break: break-all; line-height: 2; font-size: 14.5px; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);\">이제 딱 담배값만 남앗네여ㅋㅋ 인생공부 겁나게 열심히 하고갑니다. 다들 아무쪼록&nbsp;</p><p style=\"box-sizing: border-box; font-family: &quot;Nanum Gothic&quot;, Dotum, sans-serif; word-break: break-all; line-height: 2; font-size: 14.5px; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);\">항상 대승하시구 좋은일만 잇길 바랍니다.&nbsp;</p>','','',0,0,317,0,0,'sugoi','*6BF9187547DBED8F2006